// this line should not be removed
var wcClaimCenter = angular.module( "wcClaimCenter",[]);

wcClaimCenter.controller( "wcClaimCenterController", function( $scope ) {


    $scope.showDetails = false;

    //For test only
    //sessionStorage.subscriberId = '';

    //Get All Claims or a specific claim of a subscriber
    var subToFilter = '';
    if (sessionStorage.subscriberId != '') {
        subToFilter = sessionStorage.subscriberId;
        sessionStorage.subscriberId = '';
        }

    var dq = new DataQuery( 'qcGetClaims' );
    dq.setParameters({"subscriberId":subToFilter});
    dq.execute().
    	done( function() {
    		$scope.$apply(function() {
    			$scope.claims = dq.getData().data;
    		});
    	});

	//Get Subscriber Info
	$scope.getSubInfo = function(subId) { 
	    var dq = new DataQuery( 'qcGetSubscriberInfo' );
        dq.setParameters({"subscriberId":subId});
        dq.execute().
    	    done( function() {
    	    	$scope.$apply(function() {
    			    $scope.subscriberInfo = dq.getData().data;
    		    });
    	    });
	    return '';
	};

	//Get SubscriberFamily info
	$scope.getPatInfo = function(subId) { 
	    var dq = new DataQuery( 'qcGetPatientsInfo' );
        dq.setParameters({"subscriberId":subId});
        dq.execute().
    	    done( function() {
    	    	$scope.$apply(function() {
    			    $scope.patients = dq.getData().data;
    		    });
    	    });
	    return '';
	};

	//Get Audit History info
	$scope.getClaimAuditInfo = function(claimId) { 
	    var dq = new DataQuery( 'qcGetClaimAuditInfo' );
        dq.setParameters({"claimId":claimId});
        dq.execute().
    	    done( function() {
    	    	$scope.$apply(function() {
    			    $scope.claimAudit = dq.getData().data;
    		    });
    	    });
	    return '';
	};

    $scope.getAllInfo = function(arg) {

        $scope.getSubInfo(arg.rowdata.subscriberId);
        $scope.getPatInfo(arg.rowdata.subscriberId);
        $scope.showDetails = true;

        $scope.getClaimAuditInfo(arg.rowdata.id);


        return '';
    };


});
